import React from 'react';

//components
import ViewRequests from '../components/ViewRequests';

function Request() {
    return (
        <div>
            <fragment>
            <br />
            <h1 style={{ textAlign: 'center', marginBottom: '5px' }}>Raise Request</h1>

            <div className="request-body" style={{ margin: '40px' }}>
                <br />
            <ViewRequests />
                
            </div>
            </fragment>            
        </div>
    );
}

export default Request;
